  const profile = 'Profile';
  const bool = false;
  return (
    <div>
      <Header title={ profile } hasSearch={ bool } />
      <div>
        <h3 data-testid="profile-email">{ loginInput }</h3>
        <button type="button" data-testid="profile-done-btn">item</button>
        <button type="button" data-testid="profile-favorite-btn">Favorite Recipes</button>
        <button type="button" data-testid="profile-favorite-btn">Logout</button>
      </div>
      <Footer />
    </div>
  );
}

